public String getSlowDisks() {
  if (diskMetrics == null) {
    //Disk Stats not enabled
    return null;
  }
  Set<String> slowDisks = diskMetrics.getDiskOutliersStats().keySet();
  return JSON.toString(slowDisks);
}
